import {
  loadChofers,
  createChofers,
  updateChoferes,
  deleteChoferes,
  clearchoferes,
} from "../../actions/choferesActions";

import service from '../../helpers/services'

const getChoferes = () =>{
      return dispatch =>{
          service.get("/choferes/").then((res)=>{
              console.log("")
              dispatch(loadChofers(res))

          }
          )
      }
}

export default {getChoferes}
